import React from 'react';
import { makeStyles } from "@material-ui/core/styles";
import Grid from "@material-ui/core/Grid";
import { Header } from '../../components/header/Header';
import { Post } from '../../components/post/Post';
import { TabList } from '../../components/profileTabList/TabList';
import { CoverImage } from '../../components/coverImage/CoverImage';
import { WhatDoYouThing } from '../../components/whatdoyouthing/WhatDoYouThing';
import { Container, Divider } from '@material-ui/core';
const drawerWidth = 240;

const useStyles = makeStyles((theme) => ({
    root: {
        flexGrow: 1
    },
    nonePadding: {
        padding: "0!important"
    }
}));

export function Profile() {
    const classes = useStyles();

    return (
        <Container>
            <Grid container spacing={3} >
                <Grid item xs={12} className={classes.nonePadding}>
                    <Header></Header>
                </Grid>
                <Grid container style={{marginTop: "100px"}}>
                    <Grid item xs={12} style={{maxHeight: "40vh", marginBottom: "1vh"}} >
                        <CoverImage></CoverImage>
                    </Grid>
                    <Divider></Divider>
                        <TabList></TabList>
                    <Grid item xs={4} style={{padding: "1%"}}>
                        <Post></Post>
                    </Grid>
                    <Grid item xs={8} style={{padding: "1%"}}>
                        <WhatDoYouThing></WhatDoYouThing>
                        <Post></Post>
                        <Post></Post>
                    </Grid>
                </Grid>
            </Grid>
        </Container >
    );
}
